import './App.css';
import './assets/css/main.css';
import './assets/css/activity-content.css';
import "./assets/css/plugins.css";
import "./assets/css/structure.css";
import "./assets/css/main.css";
import "./plugins/apex/apexcharts.css";
import React, { useState, useEffect } from 'react'
import Loader from './Loader'
import BeginSidebar from "./BeginSidebar";
import ContentArea from './ContentArea';

function App() {
  const [loading, setLoading] = useState(true)

  useEffect(() => {
    setTimeout(() => setLoading(false), 60000000)
  }, [])

  return (
    <>
    <div className="dashboard-analytics admin-header">
  <console className="log">{loading}</console>
    {loading === false}(
      {/* BEGIN MAIN CONTAINER */}
    <div className="main-container" id="container">
      <div className="overlay"></div>
      <div className="search-overlay"></div>
      <BeginSidebar/>
      <ContentArea/>
    </div>
    {/* END MAIN CONTAINER */}
    ):(<Loader/>)





    </div>
    </>
  );
}

export default App;
